import React from "react";
import { Box, Flex, Image } from "rebass";

import "./Navbar.css";

function Navbar() {
  return (
    <Box
      p={5}
      fontSize={4}
      width={[1 / 2, 1 / 2, 1 / 2]}
      color="black"
      bg="blue"
    >
      <Box
        p={5}
        fontSize={2}
        width={[1 / 8, 1 / 8, 1 / 8]}
        height={[1 / 8, 1 / 8, 1 / 8]}
        color="black"
        bg="white"
      >
        About Us
      </Box>
    </Box>
  );
}

export default Navbar;
